  homePageOuter: {
    padding: 40,
    backgroundCover: ({ theme }) => "#f6f6f6",
    textAlign: "center" 
  },
  wrapper: {
    padding: 40,
    backgroundCover: ({ theme }) => "#f6f6f6",
    textAlign: "center"
  },
  title: {
    font: {
      size: "15Rem",
      weight: 1000
	},	  
	padding: "8Rem 0Rem 0Rem 0Rem",
	margin: ["0Rem", "0Rem", "6Rem", "0Rem"],
    color: "#24202e",
  },
  homeMenu: {
	float: "Left",

	"text-align" : "Left",
    margin: ["0Rem", "0Rem", "7Rem", "6.5Rem"]
